  "privacy_content": "<h2>Privacy Notice</h2><p>Dieser Datenschutzhinweis gilt für die Nutzung des Produkts PharmaLedger Association Electronic Product Information. </p><h2>Kontaktdaten</h2><p>a) Identität und Kontaktdaten des für die Verarbeitung Verantwortlichen bzw. Der gemeinsam für die Verarbeitung Verantwortlichen Für die Verarbeitung Ihrer Daten ist die PharmaLedger Association verantwortlich. </p> <p>b) Kontaktdaten des Datenschutzbeauftragten Das Datenschutzbüro der PharmaLedger Association ist erreichbar unter dpo@pharmaledger.org.</p><h2>Welche persönlichen Daten wir verwenden</h2><p>Wir erheben nur die technischen Daten, die für die Zustellung Ihres elektronischen Prospekts erforderlich sind. Dazu gehören Ihre IP-Adresse und die technischen Kennungen des Geräts und des Browsers, die Sie für den Zugriff auf unsere Anwendung verwenden. </p> <p>Im Einzelnen erfassen wir die folgenden Elemente Ihrer Daten.</p> <ul><li><p><em>Zugriff auf mobile Geräte.</em> Wir dürfen Sie um Zugriff oder Erlaubnis für bestimmte Funktionen Ihres Mobilgeräts bitten, einschließlich der Kamera Ihres Mobilgeräts und anderer Funktionen. Wenn Sie unseren Zugriff oder unsere Berechtigungen ändern möchten, können Sie dies in den Einstellungen Ihres Geräts tun. </p></li></ul><ul><li><p><em>Daten über mobile Geräte.</em> Wir erfassen automatisch Geräteinformationen (wie z.B. die ID, das Modell und den Hersteller Ihres mobilen Geräts), das Betriebssystem, Versionsinformationen und Systemkonfigurationsinformationen, Geräte- und Anwendungs-Identifikationsnummern, Browsertyp und -version, das Hardwaremodell, den Internet-Service-Provider und/oder Mobilfunkanbieter sowie die Internetprotokoll-(IP-)Adresse (oder den Proxy-Server). Wenn Sie unsere Anwendung(en) nutzen, können wir auch Informationen über das mit Ihrem Mobilgerät verbundene Telefonnetz, das Betriebssystem oder die Plattform Ihres Mobilgeräts, die Art des von Ihnen verwendeten Mobilgeräts, die eindeutige Geräte-ID Ihres Mobilgeräts und Informationen über die von Ihnen aufgerufenen Funktionen unserer Anwendung(en) erfassen. </p></li></ul><h2>Warum wir Ihre persönlichen Daten sammeln</h2><h3>Verwendungszwecke</h3><p>Wir erheben Ihre technischen Daten, um Ihnen eine elektronische Packungsbeilage für Ihr Medikament zukommen zu lassen. </p><p>In diesem Sinne stützen wir uns auf die folgenden Rechtsgrundlagen, um Ihre persönlichen Daten zu verarbeiten: </p> <ul><li><p><b>Erfüllung eines Vertrags.</b> Wir sind berechtigt, Ihre personenbezogenen Daten zu verarbeiten, wenn wir der Meinung sind, dass dies notwendig ist, um vertragliche Verpflichtungen Ihnen gegenüber zu erfüllen, einschließlich der Bereitstellung unserer Dienstleistungen oder auf Ihren Wunsch hin, bevor wir einen Vertrag mit Ihnen abschließen. </p></li></ul><ul><li><p><b>Gesetzliche Verpflichtungen.</b> Wir dürfen Ihre Daten verarbeiten, wenn wir der Meinung sind, dass dies zur Erfüllung unserer gesetzlichen Verpflichtungen notwendig ist, wie z.B. zur Erfüllung unserer Verpflichtungen im Rahmen der Gesundheitsvorschriften und der Gesetze zum öffentlichen Gesundheitswesen.</p></li></ul><h2>Mit wem wir Ihre persönlichen Daten teilen</h2><p>Mitgliedsunternehmen und Drittanbieter von Dienstleistungen. </p><p>Wir teilen Ihre Daten mit Drittanbietern, Dienstleistern, Auftragnehmern oder Vertretern (\"Dritte\"), die Dienstleistungen für uns oder in unserem Namen erbringen und für diese Arbeit Zugang zu diesen Informationen benötigen. Wir haben Verträge mit unseren Drittparteien abgeschlossen, die dazu dienen, Ihre persönlichen Daten zu schützen. Das bedeutet, dass diese Dritten nichts mit Ihren persönlichen Daten tun können, es sei denn, wir haben sie dazu angewiesen. Außerdem werden diese Dritten Ihre persönlichen Daten nicht an andere Organisationen als uns weitergeben. Sie verpflichten sich außerdem, die Daten, die sie in unserem Auftrag speichern, zu schützen und sie für den von uns vorgegebenen Zeitraum aufzubewahren. Die Kategorien von Dritten, an die wir persönliche Daten weitergeben können, sind wie folgt: </p> <ul><li><p>Medikamentenhersteller (Mitgliedsunternehmen) </p></li></ul><ul><li><p>Anbieter von technischen Dienstleistungen </p></li></ul><h2>Wie lange wir Ihre persönlichen Daten speichern</h2><p>Die PharmaLedger Association speichert Ihre technischen Daten nur so lange, wie es für die Bearbeitung Ihrer Prospektanforderung erforderlich ist, d.h. bis zu 30 Tage. Ihr Arzneimittelhersteller speichert Ihre Daten ebenfalls für einen bestimmten Zeitraum, der in seinen Richtlinien zur Datenaufbewahrung festgelegt ist. Für weitere Informationen zu dieser Aufbewahrung setzen Sie sich bitte mit Ihrem Arzneimittelhersteller in Verbindung. </p><h2>Wenn Sie uns Ihre persönlichen Daten nicht zur Verfügung stellen</h2><p>Wenn Sie uns Ihre technischen Daten nicht zur Verfügung stellen, können wir Ihre Anfrage nach Broschüren nicht erfüllen. </p><h2>Ihre Rechte</h2><p>Wenn Sie im Rahmen der Datenschutz-Grundverordnung (\"DSGVO\") eine Anfrage bezüglich Ihrer persönlichen Daten haben, z.B. eine Anfrage auf Zugang oder Löschung Ihrer Daten, können Sie uns unter dpo@pharmaledger.org.</p><p>Wir bearbeiten solche Anfragen innerhalb von 30 Tagen.</p><h2>Widerruf der Einwilligung</h2><p>Wenn Sie im Rahmen der Datenschutz-Grundverordnung (\"DSGVO\") eine Anfrage bezüglich Ihrer persönlichen Daten haben, z.B. eine Anfrage auf Zugang oder Löschung Ihrer Daten, können Sie uns unter dpo@pharmaledger.org.</p><p>Wir bearbeiten solche Anfragen innerhalb von 30 Tagen.</p><h2>Automatisierte Entscheidungsfindung</h2><p>Wir verwenden keine automatisierte Entscheidungsfindung bei der Bereitstellung dieses Dienstes für Sie. </p><h2>Internationale Übermittlung von personenbezogenen Daten</h2><p>Wenn Ihr Arzneimittelhersteller es erforderlich macht, dass wir Ihre Daten außerhalb der Europäischen Union übermitteln, verwenden wir Standardvertragsklauseln, um Ihre Daten zu schützen. </p><h2>Beschwerdeverfahren</h2><p>Wenn Sie eine Anfrage bezüglich Ihrer persönlichen Daten im Rahmen der GDPR haben, wie z.B. eine Anfrage zum Zugriff oder zur Löschung Ihrer Daten, können Sie uns wie folgt kontaktieren dpo@pharmaledger.org.</p><p>Wir bearbeiten solche Anfragen innerhalb von 30 Tagen. Außerdem können Sie sich an Ihre örtliche Aufsichtsbehörde wenden, wenn Sie der Meinung sind, dass Ihre Rechte nicht eingehalten werden.</p>",
