  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>Über diese App</h2><p>Diese App wird Ihnen von PharmaLedger® zur Verfügung gestellt. Sie wurde gemeinsam von Patientenvertretungen, Pharmaunternehmen und Technologieexperten entwickelt.</p><p>Benutzer können mit dieser App Produktinformationen über ihr Medikament ansehen, indem sie den Barcode auf der Verpackung scannen.</p><p>Die angezeigten Informationen werden vom Inhaber der Marktzulassung für das Produkt bereitgestellt.</p><h2>Über PharmaLedger</h2><p>PharmaLedger® ist der Markenname der PharmaLedger Association (PLA).</p><p>PLA ist ein globaler, gemeinnütziger, neutraler Verein. Zweck des Vereins ist der Aufbau und die Weiterentwicklung eines vertrauenswürdigen, digitalen Ökosystems im Gesundheitswesen.</p><p>Der Verein unterstützt die Zusammenarbeit von verschiedenen Organisationen im Gesundheitswesen und Life-Science-Bereich und fördert Innovationen und deren Umsetzung zum gemeinsamen Nutzen von Patienten und anderen Interessengruppen.</p>",
  "help_modal_title": "Hilfe",
  "help_modal_subtitle": "Häufig gestellte Fragen",
  "help_content": "<div><p><b><h2>Was ist EPI?</h2></b></p><p><b>EPI</b> steht für <b>Elektronische Produkt-Information</b>. Es ist die elektronische Version des Beipackzettels, welchen Sie in der Arzneimittelpackung vorfinden.</p><p><b><h2>Was ist PharmaLedger?</h2></b></p><p>Die PharmaLedger Association (PLA) ist eine gemeinnützige Vereinigung mit Sitz in der Schweiz. Ihr Ziel ist es, durch die Bereitstellung einer Open-Source-Plattform eine vertrauenswürdige digitale Umgebung im Gesundheitswesen zu schaffen. PLA fördert die Zusammenarbeit und beschleunigt Innovation und Transformation, um im Gesundheits- und Life-Science-Bereich gemeinsame Vorteile für Patienten und andere Interessengruppen zu erzielen. PLA wurde 2022 gegründet, um die Arbeit des PharmaLedger-Projekts fortzusetzen, welches drei Jahre lang von der Europäischen Kommission und der pharmazeutischen Industrie finanziert wurde, um den Wert von Blockchain-Technologie zu belegen. Weitere Informationen sind verfügbar unter: https://pharmaledger.org.</p><p><b>Was ist ein DataMatrix Barcode?</b></p><p>Es ist ein schwarz-weisses Symbol auf Ihrer Produktverpackung, welches ungefähr so aussieht:<br>    <img src=\"./images/barcode_example.png\" alt='Beispiel für Datamatrix-Barcode'></p><p>    <b><h2>Wie verwende ich die App?</h2></b></p><p>Befolgen Sie die Anweisungen auf der Einstiegsseite der <b>App…</b> sie zeigt ein Bild von dem <b>DataMatrix Barcode</b> auf Ihrer Verpackung. Wenn Sie den <b>DataMatrix Barcode</b> gefunden haben, klicken Sie auf die Schaltfläche „DataMatrix scannen“. Erlauben Sie der App, die Kamera zu verwenden, damit der DataMatrix Barcode gescannt werden kann. Fokussieren Sie die Kamera auf den DataMatrix Barcode. Sobald der Barcode erfolgreich gescannt wurde, wird Ihr elektronischer Beipackzettel angezeigt. Sie können auf die Schaltfläche „+“ klicken, um weitere Details zu erhalten.</p><p><b><h2>Warum kann mein DataMatrix Barcode nicht erfolgreich gescannt werden?</h2></b></p><p>Es gibt mehrere mögliche Gründe, warum nach dem Scan des <b>DataMatrix</b> Barcodes kein elektronischer Beipackzettel angezeigt wird. Ein möglicher Grund ist, dass der Barcode für die Kamera unleserlich oder unscharf ist. Bitte versuchen Sie, den Barcode an einem gut beleuchteten Ort zu scannen. Vermeiden Sie, das Bild vom Barcode zu verwackeln, indem Sie Ihre Hand z.B. auf einem Tisch abstützen.</p></div>",
